import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import './Dashboard.css';

function TrainerProfile() {
  const { id } = useParams();
  const [trainer, setTrainer] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch(`http://localhost:8000/trainers/${id}`)
      .then(res => res.json())
      .then(data => {
        setTrainer(data);
        setLoading(false);
      });
  }, [id]);

  if (loading) {
    return (
      <div className="dashboard-loading">
        <div className="loading-spinner"></div>
        <p>กำลังโหลด...</p>
      </div>
    );
  }

  if (!trainer || trainer.detail) {
    return <div className="dashboard-loading"><p>ไม่พบข้อมูล Trainer</p></div>;
  }

  // Mock data for layout preview
  const traineeList = trainer.trainee_list || [
    { id: 1, name: 'B1', email: 'B1@email.com' },
    { id: 2, name: 'B2', email: 'B2@email.com' },
  ];
  const videoList = trainer.video_list || [
    { id: 1, title: 'Cardio เบื้องต้น', url: '#' },
    { id: 2, title: 'Weight Training', url: '#' },
  ];

  return (
    <div className="dashboard">
      <nav className="dashboard-nav">
        <div className="dashboard-logo">FitAddict</div>
        <div className="dashboard-user">
          <img src={trainer.picture || '/user (1).png'} alt="Profile" className="user-avatar" onError={e => { e.target.onerror = null; e.target.src = '/user (1).png'; }} />
          <span className="user-name" style={{ fontWeight: 700, fontSize: "1.1rem", color: "#1e293b" }}>{trainer.name}</span>
        </div>
      </nav>
      <main className="dashboard-main">
        <div className="dashboard-welcome">
          <h1>โปรไฟล์ Trainer: {trainer.name}</h1>
          <p>อีเมล: {trainer.email}</p>
          <p>แต้ม: {trainer.points} | Streak: {trainer.streak}</p>
        </div>
        <div className="dashboard-stats">
          <div className="stat-card">
            <h3>
              <span className="material-icons">video_library</span>
              วิดีโอของคุณ
            </h3>
            <p>ดูและจัดการวิดีโอที่คุณอัพโหลด</p>
            <button className="action-btn">ดูวิดีโอทั้งหมด</button>
          </div>
          <div className="stat-card">
            <h3>
              <span className="material-icons">person_add</span>
              Invite Trainee
            </h3>
            <p>เชิญผู้ใช้ใหม่เข้าระบบของคุณ</p>
            <button className="action-btn">เชิญผู้ใช้</button>
          </div>
          <div className="stat-card">
            <h3>
              <span className="material-icons">groups</span>
              Trainee
            </h3>
            <p>ดูรายงานผู้เข้าอบรมของคุณ</p>
            <button className="action-btn">ดูรายงานผู้เข้าอบรม</button>
          </div>
        </div>
      </main>
    </div>
  );
}

export default TrainerProfile;
